import {Axios} from "@/services/axios.js"

export default{
     RegisterUser(data){
        try {
            awairAxios.post('users',data)
            .then(reponse => 
                console.log( {"data": reponse.data}))
        } catch (error) {
            console.log(error)
        }
    },

     LoginUser(data){
        try {
             Axios.post('auth/login',data)
            .then(reponse => {
                console.log( {"data": reponse.data})
            })
        } catch (error) {
            console.log(error)
        }
    }
}
